@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {

}
<mat-toolbar>
    <span>Event Manager</span>
    <span class="example-spacer"></span>
    <button mat-raised-button>
      NOVO EVENTO
    </button>
  </mat-toolbar>
